import React from "react";

const List = (props) => {
    const { contents } = props;

    if (!contents || contents.length ===0) return <h1>No hay ningun contenido</h1>

    return (
        <ul>
        <h2 className="Component-Title">Estos son los contenidos disponibles</h2>
        {contents.map((content) => {
            return (
                <div style={{background: "wheat", margin: "10px"}}>
                    <li key={content.id}>
                        <span className="Component-Title"><b>Nombre:</b> {content.name}</span>                            
                    </li>
                </div>

            );
        })}
    </ul>
    )
}
